import React from 'react';


class Carousel extends React.Component {
    constructor(props){
        super(props);


        this.prevSlide = this.prevSlide.bind(this);
        this.nextSlide = this.nextSlide.bind(this);
    }
    prevSlide = (e) => {
      e.preventDefault();
      console.log('prev slide');

    }
    nextSlide = (e) => {
      e.preventDefault();
      console.log('next slide');
    }
    render(){
        return  (
          <div id="carouselExample2" className="carousel slide" data-ride="carousel">
            <div className="carousel-inner">

            </div>

            <a className="carousel-control-prev" onClick={this.prevSlide} role="button" data-slide="prev">
              <span className="carousel-control-prev-icon" aria-hidden="true"><i data-feather="chevron-left"></i></span>
              <span className="sr-only">Previous</span>
            </a>
            <a className="carousel-control-next" onClick={this.nextSlide} role="button" data-slide="next">
              <span className="carousel-control-next-icon" aria-hidden="true"><i data-feather="chevron-right"></i></span>
              <span className="sr-only">Next</span>
            </a>
          </div>
        );
    }
}

export default Carousel;
